import React, { Component } from 'react';
import Particles from 'react-particles-js';
import 'react-bootstrap';
import DividerExampleSection from './Components/Divider'
import './App.css';

class App extends Component {
  render(){
    return (
      <div className='body'>
        <h1>Hello</h1>
        <Particles></Particles>
        <DividerExampleSection />
        <Particles
            params={{
              "particles": {
                  "number": {
                      "value": 200
                  },
                  "size": {
                      "value": 3
                  }
              },
              "interactivity": {
                  "events": {
                      "onhover": {
                          "enable": true,
                          "mode": "repulse"
                      }
                  }
              }
          }} />


      </div>
    );
  }
}
export default App;
